script: |
  super -f text -I q3759.spq | sort > q3759.out

inputs:
  - name: q3759.spq
    data: |
      SELECT DISTINCT + col0 + tab0.col2 + col1 * - col1 AS col1 FROM tab0 (FORMAT parquet) WHERE ( NOT NULL NOT IN ( tab0.col2 * - col1 + col2 ) AND NOT NULL = NULL ) AND NOT NULL IN ( + col1 );
  - name: tab0

outputs:
  - name: q3759.out
    data: |
